import React, { Component } from 'react';
import './App.css';
import callAPI from './modules/FetchAPI'

class App extends Component {
  componentDidMount(){
    callAPI()
  }
  render() {
    console.log(callAPI().data);

    return (
      <div className="page">
      {callAPI().data.students.map(stu=>
        <div>
          {stu}
        </div>
      )}
      </div>
    );
  }
}

export default App;
